import React, { useEffect, useState } from "react";

const Team = () => {
  const [team, setTeam] = useState([]);

  useEffect(() => {
    fetch("https://api.mocki.io/v1/b12432b1")
      .then((res) => res.json())
      .then((data) => setTeam(data));
  }, []);
  console.log(team);

  return (
    <div>
      <ul>{team.map((list) => console.log(list))}</ul>
    </div>
  );
};

export default Team;
